        'name': 'London',
        'minTemp': 10,
        'maxTemp': 20,
    }
]


function HomePage() {
    return (
        <div className="home-page">
            <MainCard currentCity={currentCity} otherCities={otherCities} />
        </div>
    )
}

export default HomePage;
